"""	
	Defines the IOTA 8.2 lattice without nonlinear element.
	Lattice adjusted for dQ = -0.1 by Sasha Romanov.
"""

class Dedge:
    """ class Dedge(Drft):
        Dipole Edge
        Trace element 9: beta, rho, g, K1, K2
        Madx: e1 = beta, h = 1/rho, hgap = g/2, fint = K1, K2 = 0.0
    """
    def __init__(self,h,e1,hgap,fint):
	    self.h = h
	    self.e1 = e1
	    self.hgap = hgap
	    self.fint = fint
        
    def tomatrix(self):
        """ Rxx, Ryy = tomatrix(self): returns thin-lens matrix of a dipole edge """
        psi = 2.0*self.fint*self.hgap*self.h*(1.+math.sin(self.e1)**2)/math.cos(self.e1)
        Rxx = np.array([[1., 0.], [self.h*math.tan(self.e1), 1.]])
        Ryy = np.array([[1., 0.], [-self.h*math.tan(self.e1-psi), 1.]])
        return Rxx, Ryy


